import React from "react";
import "./style.css";
import Menu_AdminPage from "./../../../components/menu_adminpage";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {

} from "@fortawesome/free-solid-svg-icons";
import { faSave,faMoneyBillAlt } from "@fortawesome/free-regular-svg-icons";
import {
  Select,
  Popconfirm,
  message,
  Modal,
  Form,
  Input,
  DatePicker,
  Space,
  Radio,
  Upload,
  Button,
  Table,
} from "antd";
function Revenue() {
  return (
    <div>
      <div
        style={{ backgroundColor: "#efefef", width: "100%", height: "100vmax" }}
      >
        <div style={{ display: "block" }}>
          <div style={{ height: "100px" }}>
            <Menu_AdminPage />
          </div>
          <div>
            <div className="content-part1">
              <div className="detailed-left">
                <FontAwesomeIcon icon={faMoneyBillAlt} size="2x" color="#007c7e" />
                <div className="content-detailed-left">QUẢN LÝ NGUỒN THU</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Revenue;
